import React from 'react';
const images = require.context('', true);


const Art = (props) => {
    
let img = images('../../../images/gallery/Art' + props.imageName);


    return (
        <>
<img src={img} alt="" />
        <div className="col-lg-3 col-md-4 col-6 mx-auto">
            <figure className="art_gal">
            <img className="img-fluid" src={props.img} alt="image">
        </img>
            </figure>
        </div>
       
        




        </>
    )
}

export default Art
